import React from "react";
import Currentdate from "./Currentdate";
import WeatherIcon from "./WeatherIcon";
import WeatherTemperature from "./WeatherTemperature";
import "./Weather.css";

export default function DetailedWeatherInfo(props){
    return (
      <div className="Detailed-Weather-Info">
        <p>Weather Details</p>
        <div className="row">
          <div className="col-6">
            <div className="">
              <div>Pressure</div> <div>{props.info.pressure} MPa</div>
            </div>
          </div>
          <div className="col-6">
            <div>
              <div>Humidity: {props.info.humidity} %</div>
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-6">
            {" "}
            <div>Wind: {props.info.wind} km/h</div>
          </div>
          <div className="col-6">
            {" "}
            <div>visibility: {props.info.visibility} km</div>
          </div>
        </div>
      </div>
    );
}
